import React from "react";
import { NavLink } from "react-router-dom";
import "./Auth.css";

const NavItem = ({ to, children }) => (
  <NavLink to={to} className={({ isActive }) => "nav-item" + (isActive ? " active" : "")}>
    {children}
  </NavLink>
);

const Navbar = () => {
  return (
    <aside className="sidebar">
      <div className="nav-list">
        <NavItem to="/dashboard">Home</NavItem>
        <NavItem to="/posts">Search</NavItem>
        <NavItem to="/explore">Explore</NavItem>
        <NavItem to="/reels">Reels</NavItem>
        <NavItem to="/messages">Messages</NavItem>
        <NavItem to="/notifications">Notifications</NavItem>
        <NavItem to="/posts/new">Create</NavItem>
        <NavItem to="/profile/me">Profile</NavItem>
      </div>
    </aside>
  );
};

export default Navbar;
